import React from 'react';
import { Divider, Drawer, ListItem, ListItemIcon, ListItemText, Toolbar } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';
import AccessibleIcon from '@material-ui/icons/Accessible';
import ChildCareIcon from '@material-ui/icons/ChildCare';
import ChildFriendlyIcon from '@material-ui/icons/ChildFriendly';
import EuroIcon from '@material-ui/icons/Euro';
import "./navdrawer.css";


class Navdrawer extends React.Component {
    constructor(props: any) {
        super(props);
    }
    render() {
        return (
            <div className="NavigationDrawer">
                <Drawer
                    

                    variant="permanent"
                    ModalProps={{
                        keepMounted: true,
                      }}>
                    {
                        //Here goes the Header for the Drawer, so we probably put the user Icon + name and the icons for that
                    }
                    <Toolbar/>
                    <Divider />
                    <label className="sub">Nieuws Kanalen</label>
                    
                    <ListItem button >
                        <ListItemIcon>
                            <AccessibleIcon />
                        </ListItemIcon>
                        <ListItemText primary="Belangrijk nieuws"/>
                    </ListItem>
                    
                    <Divider />
                    <label className="sub">Chat Kanalen</label>                    
                    <ListItem button >
                        <ListItemIcon>
                            <ChildCareIcon />
                        </ListItemIcon>
                        <ListItemText primary="Publiek"/>
                    </ListItem>
                    <ListItem button >
                        <ListItemIcon>
                            <ChildFriendlyIcon />
                        </ListItemIcon>
                        <ListItemText primary="Team Genoten"/>
                    </ListItem>
                    <ListItem button >
                        <ListItemIcon>
                            <EuroIcon />
                        </ListItemIcon>
                        <ListItemText primary="one more channel cuz why not"/>
                    </ListItem>
                </Drawer>
            </div>
        );
    }
}

export default Navdrawer;
